import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./Sidebar.css";


const Sidebar = ({ isOpen }) => {
    return (
        <div className={`sidebar bg-primary text-white vh-100 ${isOpen ? "open" : ""}`}>
            <ul className="nav flex-column">
                <li className="nav-item"><a href="#" className="nav-link text-white">Anasayfa</a></li>
                <li className="nav-item"><a href="#" className="nav-link text-white">Tur Takvimi</a></li>
                <li className="nav-item"><a href="#" className="nav-link text-white">Üniversite Fuarları</a></li>
                <li className="nav-item"><a href="#" className="nav-link text-white">BTO Rehberleri</a></li>
                <li className="nav-item"><a href="#" className="nav-link text-white">Puan ve Ödemeler</a></li>
                <li className="nav-item"><a href="#" className="nav-link text-white">Gönderilen Bildirimler</a></li>
                <li className="nav-item"><a href="#" className="nav-link text-white">Lise İstatistikleri</a></li>
                <li className="nav-item"><a href="#" className="nav-link text-white">Geri Bildirimler</a></li>
            </ul>
        </div>
    );
};

export default Sidebar;
